import React from 'react'
import './NavBar.css';

export default class NavBar extends React.Component {
  render() {
    return(

      <nav>
      <div><a href="/">The Logo</a></div>
      <div>
        <ul>
          <li><a href="/">Home</a></li>
          <li><a href="/">Champions List</a></li>  
        </ul>  
      </div>  

    </nav>
    )
  }
}
